searchIndex['cookie_bug'] = {"items":[[0,"","cookie_bug","## tl;dr",null,null],[5,"_01_simple","","It can parse cookies easily",null,{"inputs":[],"output":null}],[5,"_02_value_percent","","But it decodes the value",null,{"inputs":[],"output":null}],[5,"_03_value_single_percent","","And it fails if the value doesn't hold a valid percent-encoded string",null,{"inputs":[],"output":null}],[5,"_04_key_percent","","The same is true for the key: it's decoded.",null,{"inputs":[],"output":null}],[5,"_05_format","","cookie-rs comes with a handy method to display a cookie.\nIt does so by formatting as you expect.\n(It even includes the additional data used in a `Set-Cookie` header)",null,{"inputs":[],"output":null}],[5,"_06_format_perc","","If it gets a percent-encoded string like `value%2Ffoobar`,\neverything is fine, because none of the characters gets\npercent-encoded again.",null,{"inputs":[],"output":null}],[5,"_07_format_hash","","But if it has a value like `value#foobar`,\nthe `#` gets encoded.",null,{"inputs":[],"output":null}],[5,"_08_format_hash_key","","Funnily enough: percent-encoding on display is only applied to the value,\nthe key is passed through unmodified.",null,{"inputs":[],"output":null}],[5,"_09_invalid_utf8","","Because it expects to get a proper string,\nit fails to build up a cookie",null,{"inputs":[],"output":null}],[5,"_10_newline","","And now it also inserts a newline",null,{"inputs":[],"output":null}]],"paths":[]};
